package removing_stars_from_a_string

import (
	"github.com/stretchr/testify/assert"
	"leet-code/src/core/domains"
	"testing"
)

var testcase = []domains.Testcase{
	{In: "", Out: ""},
	{In: "leet**cod*e", Out: "lecoe"},
	{In: "erase*****", Out: ""},
}

func TestRemoveStars(t *testing.T) {
	for _, tt := range testcase {
		input := tt.In.(string)
		output := tt.Out.(string)
		assert.Equal(t, output, removeStars(input))
	}
}
